private boolean advanceMin(int target) throws IOException {
  if (!min.skipTo(target)) { 
    max.doc = NO_MORE_DOCS; // for further calls to docID() 
    return false;
  }
  min = min.next; // cyclic
  max = max.next; // cyclic
  return true;
}

